        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eIn this module we provide a way to canonically define a totally ordered set\n with a given number of elements.  These types have a custom \u003ccode\u003e\u003ccode\u003e\u003ca\u003eShow\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e\n instances so that their elements are displayed with usual decimal number.\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003e\u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e = {\u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e} = {1}\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003e\u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e = {\u003ccode\u003e\u003ccode\u003e\u003ca\u003eFirst\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e, \u003ccode\u003e\u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e} = {1,2}\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003e\u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e = {\u003ccode\u003e\u003ccode\u003e\u003ca\u003eFirst\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e, \u003ccode\u003e\u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eFirst\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e, \u003ccode\u003e\u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e\n \u003ccode\u003e\u003ca\u003eSucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eOne\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e} = {1,2,3}\n\u003c/p\u003e\u003cp\u003e...\n\u003c/p\u003e\u003c/div\u003e",
